export default {
    authoriseUser(context, data) {
        const coachData = {
            accessToken: context.rootGetters.userId,
            firstName: data.first,
            lastName: data.last,
            role: ['gardener', 'technical']
        };
        context.commit('authoriseUser', coachData);
    }
};
